import Foundation
import UIKit

// MARK: - NewUpcomingGame
struct NewUpcomingGames: Codable {
    let statsGameID: String
    let time: String
    var venue: String
    var home: Home
    var away: Away

    enum CodingKeys: String, CodingKey {
        case statsGameID = "statsGameId"
        case time, venue, home, away
    }
}

// MARK: - Away
