    let name, alias, id, srID: String
    let reference: String
    let splits: [Split]
    let injuries: [AwayInjury]?
    let standings: AwayStandings
//    let logo: UIImage?

    enum CodingKeys: String, CodingKey {
        case name, alias, id
        case srID = "sr_id"
        case reference, splits, injuries, standings
    }
    
